import { Link } from "react-router-dom";


function Article({info}) {
    return (
      <div className="News">
          <Link className="link" to="/noticia">
          <article>
              <h2>{info?.titulo}</h2>
              <p>{info?.fecha}</p>
              <img src={info?.foto} alt={info?.foto} />
              <h4>{info?.entradilla}</h4>
              <p>{info?.tema}</p>
          </article>
          </Link>
      </div>
    )
  }

export default Article;
